import React from 'react'
import {Navbar,Nav} from 'react-bootstrap'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faUser,faS } from '@fortawesome/free-solid-svg-icons'
//import logo from '../logo.png'
export default function MyNavbar() {
    return (
        
         <Navbar bg="light" variant="dark" className="myNavbar">
          {/* <img
        alt=""
        src={logo}
        width="30"
        height="30"
        className="d-inline-block align-top"
      /> */}
    <Navbar.Brand href="/"  style={{color:'black',fontSize:'39px',fontFamily:'RocknRoll One',fontWeight:'bold'}}>BLOG</Navbar.Brand>
    <Nav className="ml-auto"  >
      
      <Nav.Link  href="/signup"  style={{color:'black'}}>Signup <FontAwesomeIcon icon={faUser} /></Nav.Link>
      <Nav.Link   href="/login"  style={{color:'black'}}>Login<FontAwesomeIcon icon={faSign} /></Nav.Link>
    </Nav>
 
  </Navbar>
        
            
        
    )
}
